PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE Distribuidoras(                             IdDistribuidora INTEGER PRIMARY KEY NOT NULL,                             NomeDistribuidora VARCHAR(24) UNIQUE NOT NULL                            );
CREATE TABLE PostosGasolina(                                IdPosto INTEGER PRIMARY KEY NOT NULL,                                IdDistribuidora INTEGER NOT NULL,                                NomePosto VARCHAR(255) NOT NULL,                                EnderecoPosto VARCHAR(255) NOT NULL,                                BairroPosto VARCHAR(32),                                UNIQUE(IdPosto, NomePosto, EnderecoPosto, BairroPosto) ON CONFLICT REPLACE,                                FOREIGN KEY (IdDistribuidora)                                    REFERENCES Distribuidoras(IdDistribuidora)                                    ON DELETE RESTRICT                             );
CREATE TABLE Pesquisas(                                IdPesquisa INTEGER PRIMARY KEY NOT NULL,                                DataPesquisa VARCHAR(24) UNIQUE NOT NULL);
CREATE TABLE Precos(                                IdPreco INTEGER PRIMARY KEY NOT NULL,                                IdPesquisa INTEGER,                                IdPosto INTEGER,                                PrecoGasolinaComum NUMERIC,                                PrecoGasolinaAditivada NUMERIC,                                PrecoEtanol NUMERIC,                                PrecoDiesel NUMERIC,                                PrecoGNV NUMERIC, PrecoGasolinaPremium NUMERIC,                                FOREIGN KEY (IdPesquisa)                                    REFERENCES Pesquisas(IdPesquisa)                                    ON DELETE RESTRICT,                                FOREIGN KEY (IdPosto)                                    REFERENCES PostosGasolina(IdPosto)                                    ON DELETE RESTRICT);
COMMIT;
